import * as React from 'react';
import { request, setAuthHeader } from '../helpers/axios_helper';
export default class AuthContent extends React.Component {

 constructor(props) {
 super(props);
 this.state = {
  data:[],
  type: "",
  timestart:"", 
  timeend:"", 
  status:"", 
  idclient:"",
  idcenter: 1 
}
 };

 addApplication = (e) => {
  this.state.onAdd(e, this.state.type, this.state.timestart, this.state.timeend, this.state.status, this.state.idcenter, this.state.idclient);
};

onAdd = (event, type, timestart, timeend, status, idcenter, idclient) => { 
  event.preventDefault(); 
  request( 
      "POST", 
      "/messages", 
      { 
        type: type, 
        timestart: timestart, 
        timeend: timeend, 
        status: status, 
        idcenter: idcenter, 
        idclient: idclient
      }).then( 
      (response) => { 
        this.setState({ type:  type, timestart: timestart,timeend: timeend,status: status,idcenter: idcenter,idclient: idclient})
      }).catch( 
      (error) => { 
 
      } 
  ); 
};

 onChangeHandler = (event) => {
  let name = event.target.name;
  let value = event.target.value;
  this.setState({[name] : value});
};

 componentDidMount() {
 request(
 "GET",
 "/messages",
 {}).then(
  (response) => {
    const data = response.data.filter((item) => item.idclient === this.props.decodedToken?.iss)
    .map((item) => {
    return {
      id: item.id,
      type: item.type,
      timestart: new Date(item.timestart).toLocaleString(),
      timeend: new Date(item.timeend).toLocaleString(),
      price: item.price,
      status: item.status,
      idclient: item.idclient,
      idworker: item.idworker,
      idkart: item.idkart,
      idequipment: item.idequipment,
      idcenter: item.idcenter
    };
});
 this.setState({data: data})
 }).catch(
 (error) => {
 if (error.response.status === 401) {
 setAuthHeader(null);
 } else {
 this.setState({data: error.response.code})
 }

 }
 );
 };

 render() {
    return (
      <div>
        <table className="table table-striped table-bordered">
        <thead className="table-dark">
          <tr>
            <th>Номер</th>
            <th>Тип</th>
            <th>Начало</th>
            <th>Конец</th>
            <th>Цена</th>
            <th>Статус</th>
            <th>Клиент</th>
            <th>Центр</th>
          </tr>
        </thead>
        <tbody>
          {this.state.data && this.state.data.map((item) => (
              <tr>
              <td>{item.id}</td>
              <td>{item.type}</td>
              <td>{item.timestart}</td>
              <td>{item.timeend}</td>
              <td>{item.price}</td>
              <td>{item.status}</td>
              <td>{item.idclient}</td>
              <td>{item.idcenter}</td>
              </tr>
          ))}
        </tbody>
      </table>  
      <form onSubmit={this.addApplication}>
      <div className="form-outline mb-4">
      <label className="form-label" htmlFor="type">Тип</label>
      <input type="text" id="type" name="type" className="form-control" onChange={this.onChangeHandler}/>
      </div>
      <div className="form-outline mb-4">
      <label className="form-label" htmlFor="timestart">Время начала</label> 
       <input type="datetime-local" id="timestart" name="timestart" className="form-control" onChange={this.onChangeHandler}/> 
       </div>
       <div className="form-outline mb-4">
      <label className="form-label" htmlFor="timeend">Время конца</label> 
      <input type="datetime-local" id="timeend" name="timeend" className="form-control" onChange={this.onChangeHandler}/>
      </div>
      <div className="form-outline mb-4">
      <label className="form-label" htmlFor="status">Статус</label>
      <input type="text" id="status" name="status" className="form-control" onChange={this.onChangeHandler}/>
      </div>
      <div className="form-outline mb-4">
      <label className="form-label" htmlFor="idclient">Клиент</label>
      <input type="text" id="idclient" name="idclient" className="form-control" onChange={this.onChangeHandler}/>
      </div>
      <div className="form-outline mb-4">
      <label className="form-label" htmlFor="idcenter">Центр</label>
      <input type="number" id="idcenter" name="idcenter" className="form-control" onChange={this.onChangeHandler}/>
      </div>
      <button type="submit" className="btn btn-success btn-block mb-3">Добавить заявку</button>
      </form>
      </div>   
    );
  };
}
